import React from 'react';
import {
    StyleSheet,
    Text,
    SafeAreaView,
} from 'react-native';

const Profile = () => {
    return (
        <SafeAreaView style={styles.container}>
            <Text style={styles.textStyle}>Name: Patient's Name</Text>
            <Text style={styles.textStyle}>IP Number: xxxxxxxx</Text>
            <Text style={styles.textStyle}>Date of Admission: DD/MM/YY</Text>
            <Text style={styles.textStyle}>Time of Admission: HH:MM</Text>
            <Text style={styles.textStyle}>Age: xx</Text>
            <Text style={styles.textStyle}>Gender: M/F/Others</Text>
        </SafeAreaView>
    )
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      alignItems: 'center',
      justifyContent: 'center',
    },
    textStyle: {
        flex: 1,
        marginTop: 20,
        width: 300,
        height: 40,
        fontSize: 20,
        fontWeight: "bold",
        paddingHorizontal: 10,
    },
})

export default Profile;
